import Paper from "@material-ui/core/Paper";
import { withStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import React from "react";

const StyledTableCell = withStyles(theme => ({
  head: {
    backgroundColor: "#3f51b5",
    color: theme.palette.common.white
  },
  body: {
    fontSize: 14
  }
}))(TableCell);

const StyledTableRow = withStyles(theme => ({
  root: {
    "&:nth-of-type(odd)": {}
  }
}))(TableRow);

export default class Transaction extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      data: []
    };
  }

  componentDidMount() {
    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    let url = "https://stockymanager.azurewebsites.net/api/Series/S001";

    fetch(proxyurl + url)
      .then(response => response.json())
      .then(data => this.setState({ data: data }))
      .catch(() =>
        console.log("Can’t access " + url + " response. Blocked by browser?")
      );
  }
  render() {
    const useStyles = {
      table: {
        minWidth: 700
      }
    };
    const { data } = this.state.data;
    console.log(data);
    return (
      <TableContainer component={Paper}>
        <Table stickyHeader style={useStyles} aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell>Id</StyledTableCell>
              <StyledTableCell align="right">Open Time</StyledTableCell>
              <StyledTableCell align="right">Close Time</StyledTableCell>
              <StyledTableCell align="right">Pre Money</StyledTableCell>
              <StyledTableCell align="right">Post Money</StyledTableCell>
              <StyledTableCell align="right">Company Id</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data &&
              data.map((row, index) => (
                <StyledTableRow key={index}>
                  <StyledTableCell component="th" scope="row">
                    {row.id}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.openTime}
                  </StyledTableCell>
                  <StyledTableCell align="right">{row.status}</StyledTableCell>
                  <StyledTableCell align="right">
                    {row.closeTime}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.preMoney}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.postMoney}
                  </StyledTableCell>
                  <StyledTableCell align="right">
                    {row.companyId}
                  </StyledTableCell>
                </StyledTableRow>
              ))}
          </TableBody>
        </Table>
      </TableContainer>
    );
  }
}
